class SoftwareStacksManager(Resource):

    @admin_api
    @feature_flag(flag_name="VIRTUAL_DESKTOPS", mode="api")
    def get(self):
        """
        Get software stacks for virtual desktops
        ---
        openapi: 3.1.0
        operationId: getVirtualDesktopSoftwareStacks
        tags:
          - Virtual Desktops
        summary: Get software stacks
        description: Retrieves software stacks for virtual desktops, optionally filtered by stack ID (admin access required)
        security:
          - socaAuth: []
        parameters:
          - in: header
            name: X-SOCA-USER
            required: true
            schema:
              type: string
              minLength: 1
              maxLength: 64
              pattern: '^[a-zA-Z0-9._-]+$'
              example: "admin.user"
            description: SOCA username for authentication (must be admin)
          - in: header
            name: X-SOCA-TOKEN
            required: true
            schema:
              type: string
              minLength: 1
              example: "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..."
            description: SOCA authentication token
          - in: query
            name: software_stack_id
            required: false
            schema:
              type: string
              pattern: '^[0-9]+$'
              example: "1"
            description: Specific software stack ID to retrieve (returns all if not specified)
        responses:
          '200':
            description: Software stacks retrieved successfully
            content:
              application/json:
                schema:
                  type: object
                  required:
                    - success
                    - message
                  properties:
                    success:
                      type: boolean
                      example: true
                    message:
                      type: object
                      additionalProperties:
                        type: object
                        properties:
                          id:
                            type: integer
                            example: 1
                          stack_name:
                            type: string
                            example: "Ubuntu Desktop 20.04"
                          ami_id:
                            type: string
                            example: "ami-12345678"
                          base_os:
                            type: string
                            example: "ubuntu2004"
                          description:
                            type: string
                            example: "Ubuntu 20.04 with desktop environment"
                          root_size:
                            type: integer
                            example: 50
                          launch_tenancy:
                            type: string
                            example: "default"
                          virtual_desktop_profile_id:
                            type: integer
                            example: 1
                          project_ids:
                            type: array
                            items:
                              type: integer
                            example: [1, 2, 3]
          '400':
            description: Invalid software stack ID or no stacks found
          '403':
            description: Insufficient permissions or feature not enabled
        components:
          securitySchemes:
            socaAuth:
              type: apiKey
              in: header
              name: X-SOCA-USER
              description: SOCA authentication using username and token headers
        """
        parser = reqparse.RequestParser()
        parser.add_argument("software_stack_id", type=str, location="args")
        args = parser.parse_args()
        _software_stack_info = {}
        logger.debug("List all DCV Software Stacks available")
        if args["software_stack_id"] is None:
            _list_software_stacks = SoftwareStacks.query.filter_by(
                is_active=True
            ).options(joinedload(SoftwareStacks.projects))
        else:
            if (
                _software_stack_id := SocaCastEngine(
                    data=args["software_stack_id"]
                ).cast_as(int)
            ).get("success") is True:
                _list_software_stacks = SoftwareStacks.query.filter_by(
                    id=_software_stack_id.get("message"), is_active=True
                ).options(joinedload(SoftwareStacks.projects))
            else:
                return SocaError.GENERIC_ERROR(
                    helper="software_stack_id does not seems to be a valid integer"
                ).as_flask()

        if _list_software_stacks.count() == 0:
            logger.warning("No Software Stack found")
            return SocaResponse(success=False, message="No AMI found").as_flask()
        else:
            for session_info in _list_software_stacks.all():
                _software_stack_info[session_info.id] = session_info.as_dict()
                _software_stack_info[session_info.id]["project_ids"] = [
                    projects.id for projects in session_info.projects
                ]

            return SocaResponse(success=True, message=_software_stack_info).as_flask()

    @admin_api
    @feature_flag(flag_name="VIRTUAL_DESKTOPS", mode="api")
    def post(self):
        """
        Create a new software stack for virtual desktops
        ---
        openapi: 3.1.0
        operationId: createVirtualDesktopSoftwareStack
        tags:
          - Virtual Desktops
        summary: Create software stack
        description: Creates a new software stack from an AMI for virtual desktop deployment (admin access required)
        security:
          - socaAuth: []
        parameters:
          - in: header
            name: X-SOCA-USER
            required: true
            schema:
              type: string
              minLength: 1
              maxLength: 64
              pattern: '^[a-zA-Z0-9._-]+$'
              example: "admin.user"
            description: SOCA username for authentication (must be admin)
          - in: header
            name: X-SOCA-TOKEN
            required: true
            schema:
              type: string
              minLength: 1
              example: "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..."
            description: SOCA authentication token
        requestBody:
          required: true
          content:
            multipart/form-data:
              schema:
                type: object
                required:
                  - ami_id
                  - stack_name
                  - base_os
                  - root_size
                  - virtual_desktop_profile_id
                properties:
                  ami_id:
                    type: string
                    pattern: f'^ami-[0-9a-f]{8,17}$'
                    description: AMI ID to use for the software stack
                    example: "ami-12345678"
                  stack_name:
                    type: string
                    minLength: 1
                    maxLength: 100
                    description: Name for the software stack
                    example: "Ubuntu Desktop 20.04"
                  base_os:
                    type: string
                    minLength: 1
                    description: Base operating system type
                    example: "ubuntu2004"
                  root_size:
                    type: string
                    pattern: '^[0-9]+$'
                    description: Root volume size in GB
                    example: "50"
                  virtual_desktop_profile_id:
                    type: string
                    pattern: '^[0-9]+$'
                    description: ID of the virtual desktop profile to associate
                    example: "1"
                  launch_tenancy:
                    type: string
                    enum: ["default", "dedicated", "host"]
                    description: EC2 launch tenancy
                    example: "default"
                  launch_host:
                    type: string
                    pattern: f'^h-[0-9a-f]{8,17}$'
                    description: Dedicated host ID (only for host tenancy)
                    example: "h-1234567890abcdef0"
                  description:
                    type: string
                    maxLength: 500
                    description: Description of the software stack (max 500 characters)
                    example: "Ubuntu 20.04 with desktop environment and development tools"
                  thumbnail:
                    type: string
                    format: binary
                    description: Thumbnail image for the software stack
        responses:
          '200':
            description: Software stack created successfully
            content:
              application/json:
                schema:
                  type: object
                  required:
                    - success
                    - message
                  properties:
                    success:
                      type: boolean
                      example: true
                    message:
                      type: string
                      example: "ami-12345678 registered successfully in SOCA as Ubuntu Desktop 20.04"
          '400':
            description: Invalid request parameters
          '401':
            description: Authentication failed
          '403':
            description: Insufficient permissions or feature not enabled
          '409':
            description: Stack name already exists
          '500':
            description: AWS API error or database error
        components:
          securitySchemes:
            socaAuth:
              type: apiKey
              in: header
              name: X-SOCA-USER
              description: SOCA authentication using username and token headers
        """
        parser = reqparse.RequestParser()
        parser.add_argument("ami_id", type=str, location="form")
        parser.add_argument("stack_name", type=str, location="form")
        parser.add_argument("base_os", type=str, location="form")
        parser.add_argument("root_size", type=str, location="form")
        parser.add_argument("launch_tenancy", type=str, location="form")
        parser.add_argument("launch_host", type=str, location="form")
        parser.add_argument("virtual_desktop_profile_id", type=str, location="form")
        parser.add_argument("description", type=str, location="form")

        args = parser.parse_args()
        logger.debug(f"Received SoftwareStack Registration Request args {args}")
        _ami_id = args["ami_id"]
        _stack_name = str(args["stack_name"])
        _ami_base_os = args["base_os"]
        _description = "" if not args["description"] else args["description"]
        _launch_tenancy = args["launch_tenancy"]
        _launch_host = str(args["launch_host"]) if "launch_host" in args else None
        _thumbnail = request.files.get("thumbnail")
        _virtual_desktop_profile_id = args["virtual_desktop_profile_id"]

        _user = request.headers.get("X-SOCA-USER")
        if _user is None:
            return SocaError.CLIENT_MISSING_HEADER(header="X-SOCA-USER").as_flask()

        # Launch Tenancy
        if not _launch_tenancy:
            logger.warning("Tenancy not defined, default to default")
            _launch_tenancy = "default"
            _launch_host = None

        if _launch_tenancy.lower() not in ["default", "dedicated", "host"]:
            return SocaError.IMAGE_REGISTER_ERROR(
                image_id=_ami_id,
                image_label=_stack_name,
                helper=f"Invalid launch_tenancy {_launch_tenancy}, must be default, dedicated or host",
            ).as_flask()

        # Remove launch_host if we are not in host mode
        if _launch_tenancy.lower() not in {"host"}:
            _launch_host = None

        if len(_description) > 500:
            return SocaError.IMAGE_REGISTER_ERROR(
                image_id=_ami_id,
                image_label=_stack_name,
                helper="Description is too long, must be less than 500 characters",
            ).as_flask()

        _required_input = [
            "ami_id",
            "stack_name",
            "base_os",
            "root_size",
            "virtual_desktop_profile_id",
        ]
        for _input in _required_input:
            if args[_input] is None:
                return SocaError.CLIENT_MISSING_PARAMETER(parameter=_input).as_flask()

        if _ami_base_os not in config.Config.DCV_BASE_OS.keys():
            return SocaError.IMAGE_REGISTER_ERROR(
                image_id=_ami_id,
                image_label=_stack_name,
                helper=f"Invalid os {_ami_base_os}, must be one of {config.Config.DCV_BASE_OS.keys()}",
            ).as_flask()

        try:
            # Round up to the next integer size versus using int() or round() which can round _down_
            root_size: int = math.ceil(float(args["root_size"]))

        except ValueError:
            return SocaError.IMAGE_REGISTER_ERROR(
                image_id=_ami_id,
                image_label=_stack_name,
                helper="root_size must be a valid integer",
            ).as_flask()

        if SoftwareStacks.query.filter_by(
            is_active=True, stack_name=_stack_name
        ).first():
            return SocaError.IMAGE_REGISTER_ERROR(
                image_id=_ami_id,
                image_label=_stack_name,
                helper=f"AMI label {_stack_name} already exists, pick a different name or deactivate the existing one",
            ).as_flask()

        try:
            ec2_response = client_ec2.describe_images(
                ImageIds=[_ami_id],
                Filters=[{"Name": "state", "Values": ["available"]}],
            )
        except Exception as err:
            return SocaError.AWS_API_ERROR(
                service_name="ec2",
                helper=f"Unable to describe AMI {_ami_id} due to {err}",
            ).as_flask()

        logger.debug(f"API response - AMI {_ami_id}: {ec2_response}")
        if len(ec2_response["Images"]) > 0:
            # Grab the root size from the AMI to make sure our admin-input size is at least that size.
            # This prevents situations where the admin may undersize the AMI setting.
            # The size is taken from the first (0th) EBS volume within the AMI.
            _ami_root_size: int = ec2_response["Images"][0]["BlockDeviceMappings"][0][
                "Ebs"
            ]["VolumeSize"]
            _extra_logging: str = ""
            if _ami_root_size <= root_size:
                logger.debug(
                    f"AMI {_ami_id} root size requirement ({_ami_root_size}) is <= {root_size}"
                )
            else:
                logger.info(
                    f"AMI {_ami_id} root size requirement ({_ami_root_size}GB) is > specified size ({root_size}GB) - Auto-adjusting to {_ami_root_size}GB"
                )
                _extra_logging = f"(root_size auto-adjusted to {_ami_root_size}GB)"
                root_size = math.ceil(_ami_root_size)

            _ami_arch = ec2_response["Images"][0]["Architecture"]

            # thumbnail
            if _thumbnail is None:
                # default SOCA Thumbnail
                _thumbnail_b64 = """data:image/png;base64,"""

            else:
                try:
                    mime_type = _thumbnail.content_type
                    if mime_type and mime_type.startswith("image/"):
                        # Check file size before reading
                        _thumbnail.seek(0, 2)
                        file_size = _thumbnail.tell()  # Get file size in bytes
                        _thumbnail.seek(0)

                        if file_size > 20 * 1024 * 1024:  # 20MB limit
                            return SocaError.GENERIC_ERROR(
                                helper="Provided thumbnailis bigger than 20 mb"
                            ).as_flask()

                        _image_bytes = _thumbnail.read()
                    else:
                        return SocaError.GENERIC_ERROR(
                            helper="Provided thumbnail does not seems to be a valid image"
                        ).as_flask()

                    _thumbnail_b64 = f"data:image/png;base64,{base64.b64encode(_image_bytes).decode('utf-8')}"
                except Exception as err:
                    return SocaError.GENERIC_ERROR(
                        helper=f"Unable to convert thumbnail due to {err}"
                    ).as_flask()
            try:
                _family = config.Config.DCV_BASE_OS.get(_ami_base_os).get("family")
            except Exception as err:
                logger.warning(
                    f"Unable to retrieve default family for {_ami_base_os} due to {err}. Edit config.Config.DCV_BASE_OS, trying to determine by comparing base_os"
                )
                _family = "windows" if "windows" in _ami_base_os.lower() else "linux"

            _new_software_stack = SoftwareStacks(
                ami_id=_ami_id,
                ami_base_os=_ami_base_os,
                os_family=_family,
                stack_name=_stack_name,
                ami_arch=_ami_arch,
                virtual_desktop_profile_id=_virtual_desktop_profile_id,
                is_active=True,
                ami_root_disk_size=root_size,
                launch_tenancy=_launch_tenancy,
                launch_host=_launch_host,
                created_on=datetime.now(timezone.utc),
                created_by=_user,
                description=_description,
                thumbnail=_thumbnail_b64,
            )

            try:
                db.session.add(_new_software_stack)
                db.session.commit()
            except Exception as err:
                return SocaError.DB_ERROR(
                    query=_new_software_stack,
                    helper=f"Unable to add new AMI {_stack_name} {_ami_id} to DB due to {err}",
                ).as_flask()

            return SocaResponse(
                success=True,
                message=f"{_ami_id} registered successfully in SOCA as {_stack_name} {_extra_logging}",
            ).as_flask()

        else:
            return SocaError.IMAGE_REGISTER_ERROR(
                image_id=_ami_id,
                image_label=_stack_name,
                helper=f"{_ami_id} is not available in AWS account. If you just created it, make sure the state of the image is 'available' on the AWS console",
            ).as_flask()

    @admin_api
    @feature_flag(flag_name="VIRTUAL_DESKTOPS", mode="api")
    def delete(self):
        """
        Delete a software stack by deactivating it
        ---
        openapi: 3.1.0
        operationId: deleteVirtualDesktopSoftwareStack
        tags:
          - Virtual Desktops
        summary: Deactivate software stack
        description: Deactivates an existing software stack for virtual desktops by marking it as inactive (admin access required)
        security:
          - socaAuth: []
        parameters:
          - in: header
            name: X-SOCA-USER
            required: true
            schema:
              type: string
              minLength: 1
              maxLength: 64
              pattern: '^[a-zA-Z0-9._-]+$'
              example: "admin.user"
            description: SOCA username for authentication (must be admin)
          - in: header
            name: X-SOCA-TOKEN
            required: true
            schema:
              type: string
              minLength: 1
              example: "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..."
            description: SOCA authentication token
        requestBody:
          required: true
          content:
            application/x-www-form-urlencoded:
              schema:
                type: object
                required:
                  - software_stack_id
                properties:
                  software_stack_id:
                    type: string
                    pattern: '^[0-9]+$'
                    description: ID of the software stack to deactivate
                    example: "1"
        responses:
          '200':
            description: Software stack deactivated successfully
            content:
              application/json:
                schema:
                  type: object
                  required:
                    - success
                    - message
                  properties:
                    success:
                      type: boolean
                      example: true
                    message:
                      type: string
                      example: "Software Stack removed from SOCA"
          '400':
            description: Invalid request parameters
          '401':
            description: Authentication failed
          '403':
            description: Insufficient permissions or feature not enabled
          '404':
            description: Software stack not found or already deactivated
          '500':
            description: Database error
        components:
          securitySchemes:
            socaAuth:
              type: apiKey
              in: header
              name: X-SOCA-USER
              description: SOCA authentication using username and token headers
        """
        parser = reqparse.RequestParser()
        parser.add_argument("software_stack_id", type=str, location="form")

        args = parser.parse_args()
        logger.debug(f"Received AMI Delete for {args}")

        if args["software_stack_id"] is None:
            return SocaError.CLIENT_MISSING_PARAMETER(
                parameter="software_stack_id"
            ).as_flask()

        _validate_stack_id = SocaCastEngine(data=args["software_stack_id"]).cast_as(int)
        if _validate_stack_id.get("success") is True:
            _software_stack_id = _validate_stack_id.get("message")
        else:
            return SocaError.GENERIC_ERROR(
                helper=f"software_stack_id does not seems to be a valid integer {args['software_stack_id']}",
            ).as_flask()

        _user = request.headers.get("X-SOCA-USER")
        if _user is None:
            return SocaError.CLIENT_MISSING_HEADER(header="X-SOCA-USER").as_flask()

        check_session = SoftwareStacks.query.filter_by(
            id=_software_stack_id, is_active=True
        ).first()
        if check_session:
            try:
                check_session.is_active = False
                check_session.deactivated_on = datetime.now(timezone.utc)
                check_session.deactivated_by = _user
                db.session.commit()
            except Exception as err:
                return SocaError.DB_ERROR(
                    query=check_session,
                    helper=f"Unable to deactivate software stack {_software_stack_id} due to {err}",
                ).as_flask()

            logger.info(f"AMI Label {_software_stack_id} deleted from SOCA")
            return SocaResponse(
                success=True, message="Software Stack removed from SOCA"
            ).as_flask()

        else:
            return SocaError.GENERIC_ERROR(
                helper="Software Stack not found or already deactivated",
            ).as_flask()

    @admin_api
    @feature_flag(flag_name="VIRTUAL_DESKTOPS", mode="api")
    def put(self):
        """
        Update an existing software stack for virtual desktops
        ---
        openapi: 3.1.0
        operationId: updateVirtualDesktopSoftwareStack
        tags:
          - Virtual Desktops
        summary: Update software stack
        description: Updates an existing software stack configuration for virtual desktop deployment (admin access required)
        security:
          - socaAuth: []
        parameters:
          - in: header
            name: X-SOCA-USER
            required: true
            schema:
              type: string
              minLength: 1
              maxLength: 64
              pattern: '^[a-zA-Z0-9._-]+$'
              example: "admin.user"
            description: SOCA username for authentication (must be admin)
          - in: header
            name: X-SOCA-TOKEN
            required: true
            schema:
              type: string
              minLength: 1
              example: "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..."
            description: SOCA authentication token
        requestBody:
          required: true
          content:
            multipart/form-data:
              schema:
                type: object
                required:
                  - software_stack_id
                  - ami_id
                  - base_os
                  - root_size
                  - virtual_desktop_profile_id
                properties:
                  software_stack_id:
                    type: string
                    pattern: '^[0-9]+$'
                    description: ID of the software stack to update
                    example: "1"
                  ami_id:
                    type: string
                    pattern: f'^ami-[0-9a-f]{8,17}$'
                    description: Updated AMI ID for the software stack
                    example: "ami-0abcdef1234567890"
                  base_os:
                    type: string
                    minLength: 1
                    description: Updated base operating system
                    example: "ubuntu2004"
                  root_size:
                    type: string
                    pattern: '^[0-9]+$'
                    description: Updated root volume size in GB
                    example: "50"
                  virtual_desktop_profile_id:
                    type: string
                    pattern: '^[0-9]+$'
                    description: Updated virtual desktop profile ID
                    example: "1"
                  launch_tenancy:
                    type: string
                    enum: ["default", "dedicated", "host"]
                    description: Updated EC2 launch tenancy
                    example: "default"
                  launch_host:
                    type: string
                    pattern: f'^h-[0-9a-f]{8,17}$'
                    description: Updated dedicated host ID (only for host tenancy)
                    example: "h-1234567890abcdef0"
                  description:
                    type: string
                    maxLength: 500
                    description: Updated description of the software stack (max 500 characters)
                    example: "Updated Ubuntu 20.04 with desktop environment and development tools"
                  thumbnail:
                    type: string
                    format: binary
                    description: Updated thumbnail image for the software stack
        responses:
          '200':
            description: Software stack updated successfully
            content:
              application/json:
                schema:
                  type: object
                  required:
                    - success
                    - message
                  properties:
                    success:
                      type: boolean
                      example: true
                    message:
                      type: string
                      example: "ami-0abcdef1234567890 updated successfully in SOCA"
          '400':
            description: Invalid request parameters
          '401':
            description: Authentication failed
          '403':
            description: Insufficient permissions or feature not enabled
          '404':
            description: Software stack not found
          '500':
            description: Internal server error
        components:
          securitySchemes:
            socaAuth:
              type: apiKey
              in: header
              name: X-SOCA-USER
              description: SOCA authentication using username and token headers
        """
        parser = reqparse.RequestParser()
        parser.add_argument("ami_id", type=str, location="form")
        parser.add_argument("base_os", type=str, location="form")
        parser.add_argument("root_size", type=str, location="form")
        parser.add_argument("launch_tenancy", type=str, location="form")
        parser.add_argument("launch_host", type=str, location="form")
        parser.add_argument("virtual_desktop_profile_id", type=str, location="form")
        parser.add_argument("description", type=str, location="form")
        parser.add_argument("software_stack_id", type=str, location="form")

        args = parser.parse_args()
        logger.debug(f"Received SoftwareStack Update Request args {args}")
        _ami_id = args["ami_id"]
        _ami_base_os = args["base_os"]
        _description = "" if not args["description"] else args["description"]
        _launch_tenancy = args["launch_tenancy"]
        _launch_host = str(args["launch_host"]) if "launch_host" in args else None
        _thumbnail = request.files.get("thumbnail")
        _virtual_desktop_profile_id = args["virtual_desktop_profile_id"]
        _software_stack_id = args["software_stack_id"]

        _user = request.headers.get("X-SOCA-USER")
        if _user is None:
            return SocaError.CLIENT_MISSING_HEADER(header="X-SOCA-USER").as_flask()

        # Launch Tenancy
        if not _launch_tenancy:
            logger.warning("Tenancy not defined, default to default")
            _launch_tenancy = "default"
            _launch_host = None

        if _launch_tenancy.lower() not in ["default", "dedicated", "host"]:
            return SocaError.GENERIC_ERROR(
                helper=f"Invalid launch_tenancy {_launch_tenancy}, must be default, dedicated or host",
            ).as_flask()

        # Remove launch_host if we are not in host mode
        if _launch_tenancy.lower() not in {"host"}:
            _launch_host = None

        if len(_description) > 500:
            return SocaError.GENERIC_ERROR(
                helper="Description is too long, must be less than 500 characters",
            ).as_flask()

        _required_input = [
            "ami_id",
            "base_os",
            "root_size",
            "virtual_desktop_profile_id",
            "software_stack_id",
        ]
        for _input in _required_input:
            if args[_input] is None:
                return SocaError.CLIENT_MISSING_PARAMETER(parameter=_input).as_flask()

        if _ami_base_os not in config.Config.DCV_BASE_OS.keys():
            return SocaError.GENERIC_ERROR(
                helper=f"Invalid os {_ami_base_os}, must be one of {config.Config.DCV_BASE_OS.keys()}",
            ).as_flask()

        try:
            # Round up to the next integer size versus using int() or round() which can round _down_
            root_size: int = math.ceil(float(args["root_size"]))

        except ValueError:
            return SocaError.GENERIC_ERROR(
                helper="root_size must be a valid integer",
            ).as_flask()

        if SocaCastEngine(data=_software_stack_id).cast_as(int).get("success") is True:
            _software_stack_to_update = SoftwareStacks.query.filter_by(
                id=_software_stack_id, is_active=True
            ).first()
            if not _software_stack_to_update:
                return SocaError.GENERIC_ERROR(
                    helper=f"Unable to find existing stack with id {_software_stack_id}",
                ).as_flask()

        try:
            ec2_response = client_ec2.describe_images(
                ImageIds=[_ami_id],
                Filters=[{"Name": "state", "Values": ["available"]}],
            )
        except Exception as err:
            return SocaError.AWS_API_ERROR(
                service_name="ec2",
                helper=f"Unable to describe AMI {_ami_id} due to {err}",
            ).as_flask()

        logger.debug(f"API response - AMI {_ami_id}: {ec2_response}")
        if len(ec2_response["Images"]) > 0:
            # Grab the root size from the AMI to make sure our admin-input size is at least that size.
            # This prevents situations where the admin may undersize the AMI setting.
            # The size is taken from the first (0th) EBS volume within the AMI.
            _ami_root_size: int = ec2_response["Images"][0]["BlockDeviceMappings"][0][
                "Ebs"
            ]["VolumeSize"]
            _extra_logging: str = ""
            if _ami_root_size <= root_size:
                logger.debug(
                    f"AMI {_ami_id} root size requirement ({_ami_root_size}) is <= {root_size}"
                )
            else:
                logger.info(
                    f"AMI {_ami_id} root size requirement ({_ami_root_size}GB) is > specified size ({root_size}GB) - Auto-adjusting to {_ami_root_size}GB"
                )
                _extra_logging = f"(root_size auto-adjusted to {_ami_root_size}GB)"
                root_size = math.ceil(_ami_root_size)

            _ami_arch = ec2_response["Images"][0]["Architecture"]

            # thumbnail
            if _thumbnail is not None:
                try:
                    mime_type = _thumbnail.content_type
                    if mime_type and mime_type.startswith("image/"):
                        # Check file size before reading
                        _thumbnail.seek(0, 2)
                        file_size = _thumbnail.tell()  # Get file size in bytes
                        _thumbnail.seek(0)

                        if file_size > 20 * 1024 * 1024:  # 20MB limit
                            return SocaError.GENERIC_ERROR(
                                helper="Provided thumbnailis bigger than 20 mb"
                            ).as_flask()

                        _image_bytes = _thumbnail.read()
                    else:
                        return SocaError.GENERIC_ERROR(
                            helper="Provided thumbnail does not seems to be a valid image"
                        ).as_flask()

                    _thumbnail_b64 = f"data:image/png;base64,{base64.b64encode(_image_bytes).decode('utf-8')}"
                except Exception as err:
                    return SocaError.GENERIC_ERROR(
                        helper=f"Unable to convert thumbnail due to {err}"
                    ).as_flask()

            # Update existing stack # NOTE: we do not update the ami label, this one cannot be changed
            try:
                _software_stack_to_update.ami_id = _ami_id
                _software_stack_to_update.ami_base_os = _ami_base_os
                _software_stack_to_update.ami_arch = _ami_arch
                _software_stack_to_update.virtual_desktop_profile_id = (
                    _virtual_desktop_profile_id
                )
                _software_stack_to_update.launch_tenancy = _launch_tenancy
                _software_stack_to_update.launch_host = _launch_host
                _software_stack_to_update.ami_root_disk_size = root_size
                _software_stack_to_update.description = _description
                if _thumbnail is not None:
                    _software_stack_to_update.thumbnail = _thumbnail_b64
                _software_stack_to_update.last_updated_on = datetime.now(timezone.utc)
                _software_stack_to_update.last_updated_by = _user
                db.session.commit()
                return SocaResponse(
                    success=True,
                    message=f"{_ami_id} updated successfully in SOCA {_extra_logging}",
                ).as_flask()

            except Exception as err:
                return SocaError.DB_ERROR(
                    query=_software_stack_to_update,
                    helper=f"Unable to edit software stack to DB due to {err}",
                ).as_flask()

        else:
            return SocaError.GENERIC_ERROR(
                helper=f"{_ami_id} is not available in AWS account. If you just created it, make sure the state of the image is 'available' on the AWS console",
            ).as_flask()
